function Note(props) {

  function deleteNote(){

    const indexToDelete = props.index;

    props.deleteNote(indexToDelete);

  }

  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
      <button>DELETE</button>
    </div>
  );
}

export default Note;
